import { Col, Row } from 'antd'
import React from 'react'
import { Redirect, Route } from 'react-router-dom'
import MenuEvo from '../../components/MenuEvo/MenuEvo'

import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';


//const user = null;
const user = { id: 1, username: "luis" }
const { Header, Sider, Content } = Layout;

export default function LayoutSecondary({component: Component, ...rest}) {

    

    return (
        <Route {...rest}>
             {user ? 
             (<>
                
                <Layout>
                        <Sider trigger={null} collapsible collapsed={this.state.collapsed}>
                        <div className="logo" />
                        <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']}>
                            <Menu.Item key="1" icon={<UserOutlined />}>
                            nav 1
                            </Menu.Item>
                            <Menu.Item key="2" icon={<VideoCameraOutlined />}>
                            nav 2
                            </Menu.Item>
                            <Menu.Item key="3" icon={<UploadOutlined />}>
                            nav 3
                            </Menu.Item>
                        </Menu>
                        </Sider>
                        <Layout className="site-layout">
                        <Header className="site-layout-background" style={{ padding: 0 }}>
                            {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
                            className: 'trigger',
                            onClick: this.toggle,
                            })}
                        </Header>
                        <Content
                            className="site-layout-background"
                            style={{
                            margin: '24px 16px',
                            padding: 24,
                            minHeight: 280,
                            }}
                        >
                            Content
                        </Content>
                        </Layout>
                    </Layout>

                {
                // <Row>
                //     <Col span={2} className="menuSide">        
                //      <MenuEvo />
                //     </Col>
                
                //     <Col span={22} className="contentFrame">
                //         <Component/>
                //     </Col>
                // </Row> 
                }
             
             </>) : (<Redirect to="/login" />) }
       </Route>
    )
}
